import IconButton from "@mui/material/IconButton";

const Header = () => {
  return (
    <AppBar position="static">
      <Toolbar>
        <IconButton
          edge="start"
          color="inherit"
          aria-label="menu"
          sx={{ mr: 2 }}
        ></IconButton>
        <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
          <img
            src="/path/to/your/logo.png"
            alt="Logo"
            style={{ marginRight: "8px", height: "40px" }}
          />
